import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './Home';
import PatientRegistration from './PatientRegistration';
import ChartPage from './ChartPage'; // Import the updated ChartPage component
import SelectPatient from './SelectPatient'; // Import the SelectPatient component
import './App.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/register" element={<PatientRegistration />} />
        {/* Route to SelectPatient component */}
        <Route path="/select-patient" element={<SelectPatient />} />
        {/* Route to ChartPage component with patientId parameter */}
        <Route path="/charts/:patientId" element={<ChartPage />} />
        <Route path="/" element={<Home />} />
      </Routes>
    </Router>
  );
}

export default App;
